import React from "react";

export default function Sidebar(props) {

    const workElemnts = props.tbdt.map(d => {
        <li>{d.title}</li> 
    })

  return (
    <section className="pane sidebar">
      <div className="sidebar--header">
        <h3>works</h3>
        <button className="new-pixel">
          +
        </button>
      </div>
      {workElemnts}
    </section>
  );
}
